            const navContent = document.getElementById('nav-content');
            const searchInput = document.getElementById('searchInput');
            const previewFrame = document.getElementById('preview-frame');
            const emptyState = document.getElementById('empty-state');
            const toolbar = document.getElementById('toolbar');
            const currentFileName = document.getElementById('current-file-name');
            const openNewTab = document.getElementById('open-new-tab');

            // Render Navigation
            function renderNav(filter = '') {
                navContent.innerHTML = '';
                
                Object.keys(data).forEach(category => {
                    const files = data[category].filter(f => 
                        f.name.toLowerCase().includes(filter.toLowerCase())
                    );

                    if (files.length > 0) {
                        const group = document.createElement('div');
                        group.className = 'nav-group';
                        
                        const header = document.createElement('div');
                        header.className = 'nav-header';
                        header.innerHTML = `<span>${category.replace(/_/g, ' ')}</span> <span class="badge">${files.length}</span>`;
                        header.onclick = () => itemsContainer.classList.toggle('active');
                        
                        const itemsContainer = document.createElement('div');
                        itemsContainer.className = 'nav-items active'; // Default open for now

                        files.forEach(file => {
                            const item = document.createElement('a');
                            item.className = 'nav-item';
                            item.textContent = file.name;
                            item.onclick = () => loadFile(file, item);
                            itemsContainer.appendChild(item);
                        });

                        group.appendChild(header);
                        group.appendChild(itemsContainer);
                        navContent.appendChild(group);
                    }
                });
            }

            // Load File
            function loadFile(file, element) {
                // Update UI
                document.querySelectorAll('.nav-item').forEach(el => el.classList.remove('active'));
                element.classList.add('active');
                
                emptyState.style.display = 'none';
                previewFrame.style.display = 'block';
                toolbar.style.display = 'flex';
                
                previewFrame.src = file.path;
                currentFileName.textContent = file.name;
                openNewTab.href = file.path;
            }

            // Search Listener
            searchInput.addEventListener('input', (e) => renderNav(e.target.value));

            // Initial Render
            renderNav();
        </script>
